import React from 'react';
import './SolutionPage.css';

function RealEstate() {
  return (
    <div className="solution-page">
      <h1 className="solution-title">Real Estate</h1>
      <div className="solution-desc">Rosie helps real estate professionals capture leads, schedule showings, and answer property questions 24/7.</div>
      <div className="solution-section">
        <h2>Why Real Estate Pros Use Rosie</h2>
        <ul>
          <li>Lead capture and qualification</li>
          <li>Showing scheduling</li>
          <li>Property information 24/7</li>
        </ul>
      </div>
    </div>
  );
}

export default RealEstate;
